import { Injectable, signal } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Observable, tap } from 'rxjs';
import { User } from '../models/user.model';

@Injectable({
  providedIn: 'root'
})
export class AuthService {
  private apiUrl = '/api/auth';
  currentUser = signal<User | null>(null);
  isInitializing = signal<boolean>(false);

  constructor(private http: HttpClient) {}

  init() {
    const auth = localStorage.getItem('auth');
    if (auth) {
      this.isInitializing.set(true);
      // Basic validation/restore session
      this.http.post<User>(`${this.apiUrl}/login`, {}, {
        headers: new HttpHeaders({ 'Authorization': 'Basic ' + auth })
      }).subscribe({
        next: (user) => {
          this.currentUser.set(user);
          this.isInitializing.set(false);
        },
        error: () => {
          this.logout();
          this.isInitializing.set(false);
        }
      });
    }
  }

  login(login: string, password: string): Observable<User> {
    const authString = `${login}:${password}`;
    // Use a robust way to encode to Base64 that handles non-ASCII characters
    const encodedAuth = btoa(unescape(encodeURIComponent(authString)));

    const headers = new HttpHeaders({
      'Authorization': 'Basic ' + encodedAuth
    });
    return this.http.post<User>(`${this.apiUrl}/login`, {}, { headers }).pipe(
      tap(user => {
        this.currentUser.set(user);
        localStorage.setItem('auth', encodedAuth);
      })
    );
  }

  register(user: User): Observable<User> {
    return this.http.post<User>(`${this.apiUrl}/register`, user);
  }

  logout() {
    const auth = localStorage.getItem('auth');
    const headers = auth ? new HttpHeaders({ 'Authorization': 'Basic ' + auth }) : new HttpHeaders();

    this.http.post(`${this.apiUrl}/logout`, {}, { headers }).subscribe();
    this.currentUser.set(null);
    localStorage.removeItem('auth');
  }

  getAuthHeader(): string | null {
    return localStorage.getItem('auth');
  }

  isLoggedIn(): boolean {
    return this.currentUser() !== null;
  }

  isAdmin(): boolean {
    const role = this.currentUser()?.role;
    return role === 'ROLE_ADMIN' || role === 'ROLE_ADMIN_READ';
  }

  hasAdminWriteAccess(): boolean {
    return this.currentUser()?.role === 'ROLE_ADMIN';
  }
}

import { Component, ChangeDetectorRef } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { Router, RouterLink } from '@angular/router';
import { AuthService } from '../../services/auth.service';
import { TranslateModule } from '@ngx-translate/core';
import { MatCardModule } from '@angular/material/card';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatInputModule } from '@angular/material/input';
import { MatButtonModule } from '@angular/material/button';
import { MatIconModule } from '@angular/material/icon';

@Component({
  selector: 'app-login',
  standalone: true,
  imports: [CommonModule, FormsModule, RouterLink, MatCardModule, MatFormFieldModule, MatInputModule, MatButtonModule, MatIconModule, TranslateModule],
  templateUrl: './login.component.html',
  styles: [`
    .login-page {
      display: flex;
      justify-content: center;
      align-items: center;
      height: 80vh;
    }
    .login-card {
      width: 400px;
    }
    mat-form-field {
      width: 100%;
      margin-bottom: 10px;
    }
    .actions {
      display: flex;
      justify-content: space-between;
      align-items: center;
    }
    .error {
      color: #f44336;
      margin-top: 10px;
      text-align: center;
    }
  `]
})
export class LoginComponent {
  login = '';
  password = '';
  error = '';
  hidePassword = true;

  constructor(
    private authService: AuthService,
    private router: Router,
    private cdr: ChangeDetectorRef
  ) {}

  onSubmit() {
    this.authService.login(this.login, this.password).subscribe({
      next: (user) => {
        if (user.role === 'ROLE_ADMIN' || user.role === 'ROLE_ADMIN_READ') {
          this.router.navigate(['/dashboard']);
        } else {
          this.router.navigate(['/tasks']);
        }
      },
      error: (err) => {
        console.error('Login error:', err);
        this.error = 'COMMON.ERROR';
        this.cdr.detectChanges();
      }
    });
  }
}
<div class="login-page">
  <mat-card class="login-card">
    <mat-card-header>
      <mat-card-title>{{ 'NAV.LOGIN' | translate }}</mat-card-title>
    </mat-card-header>
    <mat-card-content>
      <form (ngSubmit)="onSubmit()">
        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.LOGIN' | translate }}</mat-label>
          <input matInput type="text" name="login" [(ngModel)]="login" required>
        </mat-form-field>
        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.PASSWORD' | translate }}</mat-label>
          <input matInput [type]="hidePassword ? 'password' : 'text'" name="password" [(ngModel)]="password" required>
          <button mat-icon-button matSuffix (click)="hidePassword = !hidePassword" [attr.aria-label]="'Hide password'" [attr.aria-pressed]="hidePassword" type="button">
            <mat-icon>{{hidePassword ? 'visibility_off' : 'visibility'}}</mat-icon>
          </button>
        </mat-form-field>

        <div class="actions">
          <a mat-button routerLink="/register">{{ 'ADMIN.ADD_USER' | translate }}</a>
          <button mat-raised-button color="primary" type="submit" id="login-btn">{{ 'NAV.LOGIN' | translate }}</button>
        </div>

        <p id="login-error" class="error" *ngIf="error">{{ error | translate }}</p>
      </form>
    </mat-card-content>
  </mat-card>
</div>

import { Component, ChangeDetectorRef } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { Router, RouterLink } from '@angular/router';
import { AuthService } from '../../services/auth.service';
import { TranslateModule } from '@ngx-translate/core';
import { MatCardModule } from '@angular/material/card';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatInputModule } from '@angular/material/input';
import { MatButtonModule } from '@angular/material/button';
import { MatDatepickerModule } from '@angular/material/datepicker';
import { provideNativeDateAdapter } from '@angular/material/core';
import { User } from '../../models/user.model';

@Component({
  selector: 'app-register',
  standalone: true,
  imports: [
    CommonModule,
    FormsModule,
    RouterLink,
    MatCardModule,
    MatFormFieldModule,
    MatInputModule,
    MatButtonModule,
    MatDatepickerModule,
    TranslateModule
  ],
  providers: [provideNativeDateAdapter()],
  templateUrl: './register.component.html',
  styles: [`
    .register-page {
      display: flex;
      justify-content: center;
      padding: 20px;
    }
    .register-card {
      width: 100%;
      max-width: 500px;
    }
    mat-form-field {
      width: 100%;
      margin-bottom: 10px;
    }
    .actions {
      display: flex;
      justify-content: space-between;
      align-items: center;
      margin-top: 10px;
    }
    .error { color: #f44336; margin-top: 10px; text-align: center; }
    .success { color: #4caf50; margin-top: 10px; text-align: center; }
  `]
})
export class RegisterComponent {
  user: User = {
    firstName: '',
    lastName: '',
    login: '',
    password: '',
    email: '',
    birthDate: null,
    address: ''
  };
  confirmPassword = '';
  error = '';
  message = '';

  constructor(
    private authService: AuthService,
    private router: Router,
    private cdr: ChangeDetectorRef
  ) {}

  onSubmit() {
    if (this.user.password !== this.confirmPassword) {
      this.error = 'ADMIN.ERROR_PASSWORD_MATCH';
      return;
    }

    const userToRegister = { ...this.user };
    if (userToRegister.birthDate && (userToRegister.birthDate as any) instanceof Date) {
      const date = userToRegister.birthDate as unknown as Date;
      // Ensure local date is used to avoid timezone shift to previous day
      const year = date.getFullYear();
      const month = String(date.getMonth() + 1).padStart(2, '0');
      const day = String(date.getDate()).padStart(2, '0');
      (userToRegister as any).birthDate = `${year}-${month}-${day}`;
    }

    this.authService.register(userToRegister).subscribe({
      next: () => {
        this.message = 'COMMON.SUCCESS';
        this.error = '';
        this.cdr.detectChanges();
        setTimeout(() => this.router.navigate(['/login']), 2000);
      },
      error: (err) => {
        if (err.status === 400 && typeof err.error === 'string') {
          // Backend returns specific error messages as strings
          this.error = err.error;
          // If the backend error message matches a known key or is specific,
          // we might need to handle it. For now, we display what backend says if it's not a translation key.
          // But to be safe with i18n, we should probably map common ones.
          if (this.error === 'User already exists') {
            // We could add a translation key for this too
            this.error = 'ADMIN.ERROR_USER_EXISTS';
          }
        } else {
          this.error = 'COMMON.ERROR';
        }
        this.message = '';
        this.cdr.detectChanges();
      }
    });
  }
}
<div class="register-page">
  <mat-card class="register-card">
    <mat-card-header>
      <mat-card-title>{{ 'ADMIN.CREATE_USER' | translate }}</mat-card-title>
    </mat-card-header>
    <mat-card-content>
      <form (ngSubmit)="onSubmit()" #registerForm="ngForm">
        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.FIRST_NAME' | translate }}</mat-label>
          <input matInput name="firstName" [(ngModel)]="user.firstName" required #firstName="ngModel">
          @if (firstName.invalid && (firstName.dirty || firstName.touched)) {
            <mat-error>{{ 'ADMIN.ERROR_REQUIRED' | translate }}</mat-error>
          }
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.LAST_NAME' | translate }}</mat-label>
          <input matInput name="lastName" [(ngModel)]="user.lastName" required #lastName="ngModel">
          @if (lastName.invalid && (lastName.dirty || lastName.touched)) {
            <mat-error>{{ 'ADMIN.ERROR_REQUIRED' | translate }}</mat-error>
          }
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.LOGIN' | translate }}</mat-label>
          <input matInput name="login" [(ngModel)]="user.login" required #login="ngModel">
          @if (login.invalid && (login.dirty || login.touched)) {
            <mat-error>{{ 'ADMIN.ERROR_REQUIRED' | translate }}</mat-error>
          }
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.PASSWORD' | translate }}</mat-label>
          <input matInput type="password" name="password" [(ngModel)]="user.password" required id="password" #password="ngModel">
          @if (password.invalid && (password.dirty || password.touched)) {
            <mat-error>{{ 'ADMIN.ERROR_REQUIRED' | translate }}</mat-error>
          }
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.CONFIRM_PASSWORD' | translate }}</mat-label>
          <input matInput type="password" name="confirmPassword" [(ngModel)]="confirmPassword" required id="confirm-password" #confirmPwd="ngModel">
          @if (confirmPwd.invalid && (confirmPwd.dirty || confirmPwd.touched)) {
            <mat-error>{{ 'ADMIN.ERROR_REQUIRED' | translate }}</mat-error>
          }
          @if (user.password !== confirmPassword && confirmPassword && !confirmPwd.invalid) {
            <mat-error>{{ 'ADMIN.ERROR_PASSWORD_MATCH' | translate }}</mat-error>
          }
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.EMAIL' | translate }}</mat-label>
          <input matInput type="email" name="email" [(ngModel)]="user.email" required email #email="ngModel">
          @if (email.invalid && (email.dirty || email.touched)) {
            <mat-error>{{ 'ADMIN.ERROR_EMAIL' | translate }}</mat-error>
          }
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.BIRTH_DATE' | translate }}</mat-label>
          <input matInput [matDatepicker]="picker" name="birthDate" [(ngModel)]="user.birthDate" required #birthDate="ngModel">
          <mat-datepicker-toggle matIconSuffix [for]="picker"></mat-datepicker-toggle>
          <mat-datepicker #picker></mat-datepicker>
          @if (birthDate.invalid && (birthDate.dirty || birthDate.touched)) {
            <mat-error>{{ 'ADMIN.ERROR_REQUIRED' | translate }}</mat-error>
          }
        </mat-form-field>

        <div class="actions">
          <button mat-raised-button color="primary" type="submit" [disabled]="!registerForm.form.valid || user.password !== confirmPassword" id="register-btn">{{ 'ADMIN.ADD_USER' | translate }}</button>
          <a mat-button routerLink="/login">{{ 'NAV.LOGIN' | translate }}</a>
        </div>

        @if (error) {
          <p class="error">{{ error | translate }}</p>
        }
        @if (message) {
          <p class="success">{{ message | translate }}</p>
        }
      </form>
    </mat-card-content>
  </mat-card>
</div>

import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Observable } from 'rxjs';
import { User } from '../models/user.model';
import { AuthService } from './auth.service';

@Injectable({
  providedIn: 'root'
})
export class UserService {
  private apiUrl = '/api/users';

  constructor(private http: HttpClient, private authService: AuthService) {}

  private getHeaders(): HttpHeaders {
    const auth = this.authService.getAuthHeader();
    return new HttpHeaders({
      'Authorization': 'Basic ' + auth,
      'Content-Type': 'application/json'
    });
  }

  getCurrentUser(): Observable<User> {
    return this.http.get<User>(`${this.apiUrl}/me`, { headers: this.getHeaders() });
  }

  updateCurrentUser(user: User): Observable<User> {
    return this.http.put<User>(`${this.apiUrl}/me`, user, { headers: this.getHeaders() });
  }
}

import { Component, OnInit, ChangeDetectorRef } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { Router } from '@angular/router';
import { User } from '../../models/user.model';
import { UserService } from '../../services/user.service';
import { AuthService } from '../../services/auth.service';
import { TranslateModule } from '@ngx-translate/core';
import { MatCardModule } from '@angular/material/card';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatInputModule } from '@angular/material/input';
import { MatButtonModule } from '@angular/material/button';
import { MatDatepickerModule } from '@angular/material/datepicker';
import { provideNativeDateAdapter } from '@angular/material/core';

@Component({
  selector: 'app-profile',
  standalone: true,
  imports: [
    CommonModule,
    FormsModule,
    MatCardModule,
    MatFormFieldModule,
    MatInputModule,
    MatButtonModule,
    MatDatepickerModule,
    TranslateModule
  ],
  providers: [provideNativeDateAdapter()],
  templateUrl: './profile.component.html',
  styles: [`
    .profile-page {
      display: flex;
      justify-content: center;
      padding: 20px;
    }
    .profile-card {
      width: 100%;
      max-width: 500px;
    }
    mat-form-field {
      width: 100%;
      margin-bottom: 10px;
    }
    .actions {
      display: flex;
      flex-direction: column;
      gap: 10px;
    }
    .success { color: #4caf50; margin-top: 10px; text-align: center; }
    .error { color: #f44336; margin-top: 10px; text-align: center; }
  `]
})
export class ProfileComponent implements OnInit {
  user?: User;
  message = '';

  constructor(
    private userService: UserService,
    private authService: AuthService,
    private router: Router,
    private cdr: ChangeDetectorRef
  ) {}

  ngOnInit() {
    this.userService.getCurrentUser().subscribe({
      next: (user) => {
        this.user = user;
        this.cdr.detectChanges();
      },
      error: (err) => {
        console.error('Error fetching user profile:', err);
        this.router.navigate(['/login']);
      }
    });
  }

  onSubmit() {
    if (this.user) {
      const userToSave = { ...this.user };
      if (userToSave.birthDate) {
        const d = new Date(userToSave.birthDate);
        if (!isNaN(d.getTime())) {
          // Format to YYYY-MM-DD
          const year = d.getFullYear();
          const month = String(d.getMonth() + 1).padStart(2, '0');
          const day = String(d.getDate()).padStart(2, '0');
          userToSave.birthDate = `${year}-${month}-${day}`;
        }
      }

      this.userService.updateCurrentUser(userToSave).subscribe({
        next: () => {
          this.message = 'COMMON.SUCCESS';
          this.cdr.detectChanges();
        },
        error: () => {
          this.message = 'COMMON.ERROR';
          this.cdr.detectChanges();
        }
      });
    }
  }

  onLogout() {
    this.authService.logout();
    this.router.navigate(['/login']);
  }
}
<div class="profile-page">
  @if (user) {
  <mat-card class="profile-card">
    <mat-card-header>
      <mat-card-title>{{ 'NAV.PROFILE' | translate }}</mat-card-title>
    </mat-card-header>
    <mat-card-content>
      <form (ngSubmit)="onSubmit()" #profileForm="ngForm">
        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.FIRST_NAME' | translate }}</mat-label>
          <input matInput name="firstName" [(ngModel)]="user.firstName" required>
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.LAST_NAME' | translate }}</mat-label>
          <input matInput name="lastName" [(ngModel)]="user.lastName" required>
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.LOGIN' | translate }}</mat-label>
          <input matInput name="login" [(ngModel)]="user.login" disabled>
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.EMAIL' | translate }}</mat-label>
          <input matInput type="email" name="email" [(ngModel)]="user.email" required email #email="ngModel">
          @if (email.invalid && (email.dirty || email.touched)) {
            <mat-error>{{ 'ADMIN.ERROR_EMAIL' | translate }}</mat-error>
          }
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.BIRTH_DATE' | translate }}</mat-label>
          <input matInput [matDatepicker]="picker" name="birthDate" [(ngModel)]="user.birthDate">
          <mat-datepicker-toggle matIconSuffix [for]="picker"></mat-datepicker-toggle>
          <mat-datepicker #picker></mat-datepicker>
        </mat-form-field>

        <mat-form-field appearance="fill">
          <mat-label>{{ 'ADMIN.ADDRESS' | translate }}</mat-label>
          <textarea matInput name="address" [(ngModel)]="user.address"></textarea>
        </mat-form-field>

        <div class="actions">
          <button mat-raised-button color="primary" type="submit" id="save-btn" [disabled]="!profileForm.form.valid">{{ 'ADMIN.SAVE' | translate }}</button>
        </div>

        @if (message) {
          <p id="profile-message" [class.success]="message === 'COMMON.SUCCESS'" [class.error]="message === 'COMMON.ERROR'">
            {{ message | translate }}
          </p>
        }
      </form>
    </mat-card-content>
  </mat-card>
  }
</div>

export enum Priority {
  LOW = 'LOW',
  MEDIUM = 'MEDIUM',
  HIGH = 'HIGH'
}

export enum TaskStatus {
  OPEN = 'OPEN',
  IN_PROGRESS = 'IN_PROGRESS',
  CLOSED = 'CLOSED'
}

export interface Task {
  id?: number;
  title: string;
  description: string;
  dueDate: string;
  priority: Priority;
  status: TaskStatus;
  position?: number;
  createdAt?: string;
}

