export class UserAdminComponent implements OnInit {
  users: User[] = [];
  displayedColumns: string[] = ['login', 'name', 'email', 'role', 'actions'];
  editingUser: User | null = null;
  error: string | null = null;
  isCreating = false;
  isMobile = false;

  constructor(
    public authService: AuthService,
    private adminService: AdminService,
    private dialog: MatDialog,
    private cdr: ChangeDetectorRef,
    private breakpointObserver: BreakpointObserver
  ) {}

  ngOnInit() {
    this.breakpointObserver.observe([
      Breakpoints.HandsetPortrait
    ]).subscribe(result => {
      this.isMobile = result.matches;
      this.cdr.detectChanges();
    });

    if (this.authService.isAdmin()) {
      this.loadUsers();
    }
  }

  loadUsers() {
    this.adminService.getUsers().subscribe(users => {
      this.users = users;
      this.cdr.detectChanges();
    });
  }

  createNewUser() {
    this.editingUser = {
      firstName: '',
      lastName: '',
      login: '',
      password: '',
      email: '',
      role: 'ROLE_USER',
      birthDate: '',
      address: ''
    };
    this.isCreating = true;
    this.error = null;
    this.cdr.detectChanges();
  }

  editUser(user: User) {
    this.editingUser = { ...user };
    this.isCreating = false;
    this.error = null;
    this.cdr.detectChanges();
  }

  cancelEdit() {
    this.editingUser = null;
    this.isCreating = false;
    this.error = null;
    this.cdr.detectChanges();
  }

  saveUser() {
    if (this.editingUser) {
      const operation = this.isCreating
        ? this.adminService.createUser(this.editingUser)
        : this.adminService.updateUser(this.editingUser.id!, this.editingUser);

      operation.subscribe({
        next: () => {
          this.loadUsers();
          this.editingUser = null;
          this.isCreating = false;
        },
        error: (err) => {
          this.error = err.error || 'Operation failed';
          this.cdr.detectChanges();
        }
      });
    }
  }

  deleteUser(user: User) {
    const dialogRef = this.dialog.open(ConfirmDialogComponent);
    dialogRef.afterClosed().subscribe(result => {
      if (result && user.id) {
        this.adminService.deleteUser(user.id).subscribe({
          next: () => this.loadUsers(),
          error: (err) => {
            alert(err.error || 'Failed to delete user');
          }
        });
      }
    });
  }
}
